import React from 'react';
import "./landingpage.css";
import {Container,Row} from 'react-bootstrap';
const Landingpage = () => {
  return <div className='main'>
        <Container>
            <Row>
                <div className='intro-text'>
                    <div>
                        <h1>Welcome to Pok</h1>
                    </div>
                </div>
            </Row>
        </Container>
    </div>

}

export default Landingpage;
